import React from 'react'
import Image from '../Image.jpeg'
import GirlImage from '../GirlImage.jpeg'

const ToddlerImage = () => {
    return (
        <div className="toddler-image">
            <h4 id='image-hfour'>We believe learning comes from interactive play!</h4>
            <img id='toddlers-playing' src={Image} alt='Toddlers playing'/><br />
            <img id='girl' src={GirlImage} alt='Girl' />
        </div>
    )
}

export default ToddlerImage
